import React from 'react';

const styles = {
    borderColor: 'black'
}

const TaskOwner = (props) => {
    return (
        <div>
           <h4>I'm the task owner</h4>
            <label>Name: </label>
            <input type="text" value = {props.name}  style={styles} />
            <label>Task: </label>
            <input type="text" value = {props.task} style={styles} />
        </div>
    );
}

export default TaskOwner;
